function magicMan() {
  d3.select('body')
    .append('div')
    .html(atob(""))
    .select('svg')
    .attr('height', 100)
    .attr('width', 100)
}

(function() {
  var margin = {top: 40, right: 70, bottom: 40, left: 70},
      width = 860 - margin.left - margin.right,
      height = 400 - margin.top - margin.bottom;

  var svg = d3.select("svg");

  d3.queue()
  	.defer(d3.csv, "data-more.csv")
  	.await(ready);

  function ready(error, datapoints) {
	svg.selectAll(".straw")
		.data(datapoints)
		.enter().append("rect")
		.attr("class", "straw")
		.attr("height", 80)
		.attr("width", 2)
		.attr("y", 20)
		.attr("x", function(d, i) {
			return i * 5 + 5;
		});
	d3.select("#gnome").remove();	

	magicMan();

	d3.select("#straw-gold")
	  .on("click", function(){
	    d3.select("#ring").remove();
	    d3.selectAll(".straw")
	      .attr("fill", "gold")
	})
  }

})();
